import styled from "styled-components";
export const SideBar = styled.div `
	width: 25%;
	padding: 20px;
	font-family: monospace;
`

export const UserList = styled.ul`

`

export const UserItem = styled.li `
	list-style-type: none;
	padding: 5px;
	border: 3px solid #022a92;
	border-radius: 3px;
`
